dsmonHostTopNCtlRequestedSize = MibTableColumn((1, 3, 6, 1, 2, 1, 16, 26, 1, 4, 3, 1, 7), Integer32().subtype(subtypeSpec=ValueRangeConstraint(0, 2147483647)).clone(150)).setMaxAccess("readcreate")
